import React, { Component } from 'react';

const MONTH_NAMES = [
    'January',
    'February',
    'March',
    'April',
    'May',
    'June',
    'July',
    'August',
    'September',
    'October',
    'November',
    'December',
];

export class Calendar extends Component {
    state = {
        currDate: Date.now().setDate(1),
        daysWithEvents: [],
    };

    convertMonthNumberToString = (monthNumber) => {
        return MONTH_NAMES(monthNumber);
    };

    render() {
        const days = [];

        return (
            <div className="calendar">
                <div className="calendar__navbar">
                    <div className="calendar__arrow">L</div>
                    <h1 className="calendar__title">{this.state.currMonth}</h1>
                    <div className="calendar__arrow">R</div>
                </div>
                <div className="calendar__days-box"></div>
            </div>
        );
    }
}

export default Calendar;
